import React from 'react';
import './Card.css';

const Card = (props) => {

    return (

        <div className='wrapper'>
            <ul>
                <li>id:{props.id}</li>
                <li>name:{props.name}</li>
                <li>date:{props.date}</li>
            </ul>
        </div>

    );
};

export default Card;
